"use strict";
$(document).ready(function () {
    $(".project-progress-1, .team-progress-1").circleProgress({
        max: 100,
        value: 40,
        textFormat: "percent"
    }), $(".project-progress-2, .team-progress-2").circleProgress({
        max: 100,
        value: 65,
        textFormat: "percent"
    }), $(".project-progress-3, .team-progress-3").circleProgress({
        max: 100,
        value: 50,
        textFormat: "percent"
    }), $(".project-progress-4, .team-progress-4").circleProgress({max: 100, value: 75, textFormat: "percent"})
}), $(document).ready(function () {
    $.getJSON("/tasks/calendar-tasks", function(data) {
    $("#project-calendar").simpleCalendar({
            displayEvent: true,
            events: data,
            disableEventDetails: false,
            disableEmptyDetails: false
        });
    });
}), $(document).ready(function () {
    new ApexCharts(document.querySelector("#project-statistics-chart"), {
        chart: {height: 365, type: "area", stacked: !1, toolbar: {show: !1}},
        xaxis: {
            categories: ["Shanba", "Yakshanba", "Dushanba", "Seshanba", "Chorshanba", "Payshanba", "Juma"],
            axisBorder: {show: !1},
            axisTicks: {show: !1},
            labels: {style: {fontSize: "11px", colors: "#64748b"}}
        },
        yaxis: {
            labels: {
                formatter: function (e) {
                    return +e + "K"
                }, offsetX: -22, offsetY: 0, style: {fontSize: "11px", color: "#64748b"}
            }
        },
        stroke: {curve: "smooth", width: [1, 1, 1, 1], dashArray: [3, 3, 3, 3], lineCap: "round"},
        grid: {
            padding: {left: 0, right: 0},
            strokeDashArray: 3,
            borderColor: "#ebebf3",
            row: {colors: ["#ebebf3", "transparent"], opacity: .02}
        },
        legend: {show: !1},
        colors: ["#3454d1", "#25b865", "#e49e3d"],
        dataLabels: {enabled: !1},
        fill: {type: "gradient", gradient: {shadeIntensity: 1, opacityFrom: .4, opacityTo: .3, stops: [0, 100]}},
        series: [{
            name: "Tasks Completed",
            data: [20, 45, 25, 60, 30, 65, 35],
            type: "area"
        }, {name: "Project Complated", data: [30, 25, 40, 35, 50, 40, 60], type: "area"}, {
            name: "Upcomming Project",
            data: [45, 20, 50, 25, 65, 30, 75],
            type: "area"
        }],
        tooltip: {
            y: {
                formatter: function (e) {
                    return +e + "K"
                }
            }, style: {fontSize: "11px", fontFamily: "Inter"}
        }
    }).render()
}), $(document).ready(function () {
    var e = {
        chart: {height: 325, width: "100%", stacked: !1, type: "bar", toolbar: {show: !1}},
        stroke: {show: !1},
        plotOptions: {
            bar: {
                endingShape: "rounded",
                columnWidth: "25%",
                distributed: !0,
                dataLabels: {position: "top"}
            }
        },
        dataLabels: {
            enabled: !0, formatter: function (e) {
                return e + "MIN"
            }, offsetY: 20, style: {fontSize: "12px", colors: ["#304758"]}
        },
        dataLabels: {enabled: !1},
        colors: ["#E9EDF7", "#E9EDF7", "#E9EDF7", "#3454D1", "#E9EDF7", "#E9EDF7", "#E9EDF7"],
        series: [{name: "Spent", data: [200, 300, 400, 500, 460, 420, 380]}],
        markers: {size: 0},
        xaxis: {
            categories: ["SHA", "YAK", "DUSH", "SESH", "CHOR", "PAY", "JUM"],
            axisBorder: {show: !1},
            axisTicks: {show: !1},
            labels: {style: {fontSize: "10px", colors: "#64748b"}}
        },
        yaxis: {
            labels: {
                formatter: function (e) {
                    return +e + "M"
                }, offsetX: -5, offsetY: 0, style: {color: "#64748b"}
            }
        },
        grid: {xaxis: {lines: {show: !1}}, yaxis: {lines: {show: !1}}},
        tooltip: {
            y: {
                formatter: function (e) {
                    return +e + " MIN"
                }
            }, style: {fontSize: "12px", fontFamily: "Inter"}
        },
        legend: {show: !1, labels: {fontSize: "12px", colors: "#64748b"}, fontSize: "12px", fontFamily: "Inter"}
    };
    new ApexCharts(document.querySelector("#weekly-time-spent-chart"), e).render()
});